      <Layout />
      <p>Home page</p>
      <p>This is content home page</p>
    </div>
  );
};

Index.getInitialProps = async () => {
  const data = await fetch('https://jsonplaceholder.typicode.com/posts');
  const result = await data.json();

}

export default Index;
